import React from "react";
import Container from "react-bootstrap/Container";
import Button from "react-bootstrap/Button";
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';

import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";

function Place() {
 return (
  <Container className="container_center" fluid>
   <img className="party_flower" src="/images/nhatrang.jpeg" />

   <h1 style={{ fontFamily: "Lora, italic", marginTop: 30 }}>
    {" "}
    N H A &nbsp; T R A N G &nbsp;
   </h1>
   {/* <h3 style={{fontFamily:"Lora, italic", marginTop: 20}}> Things to do </h3> */}
   <p>
    We are so excited to welcome you in our{" "}
    <b>favorite beach city in Vietnam, Nha Trang. </b>
    <br></br>
    Here's what we recommend for your enjoyable stay!
   </p>
   {/* <Button variant="outline-dark" style={{fontFamily:"Lora", borderRadius: '10px'}}> Mia Resort </Button>
    <Button variant="outline-dark" > Eat </Button>
    <Button variant="outline-dark" > Drink  </Button>
    <Button variant="outline-dark" > Sightseeing </Button> */}
   <Navbar expand="lg" className="bg-body-tertiary">
    <Container>
     <Navbar.Toggle aria-controls="basic-navbar-nav" />
     <Navbar.Collapse id="basic-navbar-nav">
      <Nav className="me-auto">
       <Nav.Link href="#home">Home</Nav.Link>
       <Nav.Link href="#link">Link</Nav.Link>
       <NavDropdown title="Dropdown" id="basic-nav-dropdown">
        <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
        <NavDropdown.Item href="#action/3.2">Another action</NavDropdown.Item>
        <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
        <NavDropdown.Divider />
        <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
       </NavDropdown>
      </Nav>
     </Navbar.Collapse>
    </Container>
   </Navbar>
  </Container>
 );
}

export default Place;
